INSERT INTO `Charities` (`id`, `name`, `short_description`, `long_description`, `image`, `status`, `createdAt`, `updatedAt`, `AccountId`) VALUES
(1, 'New Charity', 'New Charity Description', '', 'http://54.90.62.46:4800/5qvihat3sbw_1592044245561.jpeg', 0, '2020-06-13 10:30:46', '2020-06-13 20:09:57', NULL),
(2, 'New Charity', 'New Charity Description', 'New Charity Description, New Charity Description', 'http://54.90.62.46:4800/55ua46mlzlp_1592044301205.jpeg', 0, '2020-06-13 10:31:51', '2020-06-13 20:03:01', NULL),
(3, 'New Charity', 'New Charity Description', 'New Charity Description, New Charity Description', 'http://54.90.62.46:4800/rri44n2d91k_1592044311521.jpeg', 0, '2020-06-13 10:31:56', '2020-06-13 10:32:06', NULL),
(4, 'Akshaya Patra 1', 'No child in India shall be deprived of education because of hunger (edit)', 'At Akshaya Patra, we dream of a world where families won’t have to choose between food and education for their children. A wholesome meal prompts children, especially girls, to stay out of the workforce and attend school thereby addressing both classroom hunger and education. With the continued kindness of donors and supporters, Akshaya Patra will meet its goal to serve more children throughout India.', 'http://54.90.62.46:4800/stnrsa90ue_1592078300709.png', 1, '2020-06-13 19:58:20', '2020-06-13 20:30:27', NULL),
(5, 'Smile Foundation', 'Work as a catalyst in bringing sustainable change in the lives of underprivileged children, youth ', 'Smile Foundation is to empower underprivileged children, youth and women through relevant education, innovative healthcare and market-focused livelihood programmes.\n\n\nSmile Foundation is to deploy best possible methodology and technology for achieving ideal SROI (social return on investment), to practice and promote good governance. To link business competitiveness of the corporate with social development initiatives; also to sensitize privileged children (test edit)', 'http://54.90.62.46:4800/ea37mfs8mai_1592078572923.png', 1, '2020-06-13 20:02:53', '2020-06-13 20:09:48', NULL),
(6, 'Nanhi Kali', 'Find out who we are and what we do for the girl child\n', 'Project Nanhi Kali is one of India’s largest programmes that enables underprivileged girls to complete 10 years of schooling. The project provides daily academic support as well as an annual school supplies kit, which allow the girls to attend school with dignity.\n\n', 'http://54.90.62.46:4800/24a1jt7csf3_1592078917952.png', 1, '2020-06-13 20:08:38', '2020-06-13 20:08:38', NULL),
(7, 'HelpAge India', 'HelpAge India is a leading charity platform in India working with and for disadvantaged elderly for ', 'HelpAge India is a leading charity in India working with and for disadvantaged elderly for nearly 4 decades. It was set up in 1978 and is registered under the Societies’ Registration Act of 1860. There are an estimated 106 million elderly in India. HelpAge advocates for their needs such as for Universal Pension, quality healthcare, action against Elder Abuse and many more at a national, state and societal level with Central and State governments. It advocates for elder friendly policies and thei', 'http://54.90.62.46:4800/evd80vrjdc_1592079073478.png', 2, '2020-06-13 20:11:13', '2020-06-13 20:34:01', NULL),
(8, 'Make-A-Wish', 'Together, we create life-changing wishes for children with critical illnesses.\n', 'Wishes are more than just a nice thing. And they are far more than gifts, or singular events in time. Wishes impact everyone involved—wish kids, volunteers, donors, sponsors, medical professionals and communities. For wish kids, just the act of making their wish come true can give them the courage to comply with their medical treatments. Parents might finally feel like they can be optimistic. And still others might realize all they have to offer the world through volunteer work or philanthropy. ', 'http://54.90.62.46:4800/n1nddpx4bcm_1592080384087.png', 1, '2020-06-13 20:33:04', '2020-06-13 20:33:04', NULL);
