INSERT INTO `faqs` (`id`, `faq_section`, `faq_questions`, `faq_answers`, `status`, `createdAt`, `updatedAt`) VALUES
(1, 'section-1', 'Can your product work on multiple domains?', '\r\nIn our example, if the answer to the question were negative, we could use phrases like, “We do not currently support…” or “Right now this is not possible…but…”\r\n\r\nIn negative responses, we would try to avoid writing a blatant “No” as the answer.\r\n\r\nBut if the answer were a “Yes,” we could say so and then add a supporting line that could read something similar to – “Yes, our product works on multiple domains ( followed by conditions if any)…” and then a link to the further instructions for making the product work on multiple domains.', 1, '2020-07-09 10:50:16', '2020-07-09 10:50:16'),
(2, 'section-1', 'What are the different payment methods that you accept?', ' A how-style question shows that a reader wants to “do” something. When writing the response of a how-to answer, first determine if the answer is short and can be answered right away, or if it would make sense to link to the most relevant article from your knowledge base.', 1, '2020-07-09 10:50:16', '2020-07-09 10:50:16'),
(3, 'section-2', 'How can I clear the historic data? ', 'If our tool had a simple reset button somewhere on the dashboard, we would choose to give simple instructions to reach that button.\r\n\r\nHowever, if the method of clearing the data were not so straightforward, we would prefer linking to a support article that handled the topic.', 1, '2020-07-09 10:59:40', '2020-07-09 10:59:40'),
(4, 'section-2', 'Why do you need access to my Google Analytics account?', 'In our case, we could tell the users that we needed the access to connect our tool with the user’s site’s historic data. Further, to reassure our users, we could state that we never tracked any personally identifiable information.', 1, '2020-07-09 11:00:22', '2020-07-09 11:00:22');
