(16, 'Beautiful Baby', '', 0, '', '', '#7a5656', 10, 'Lorem ipsum dolor. Lorem ipsum dolor lorem ipsum dolor lorem ipsum dolor.Lorem ipsum dolor. Lorem ipsum dolor lorem ipsum dolor lorem ipsum dolor.Lorem ipsum dolor. Lorem ipsum dolor lorem ipsum dolor lorem ipsum dolor.Lorem ipsum dolor. Lorem ipsum dolor lorem ipsum dolor lorem ipsum dolor.', 'http://54.90.62.46:4800/xv6wlknauhr_1594262523687.jpeg', 'http://54.90.62.46:4800/ytmfsvjjez_1594262523142.jpeg', '', '', 0, 0, '2020-06-27 18:25:00', '2020-07-10 22:45:43', 1, 1),
(17, 'The demoness', '', 0, '', '', '#a09a9a', 10, 'Krishna’s uncle Kamsa was an evil king. Before Krishna’s birth, a prophecy was foretold. Kamsa would be vanquished by Krishna - the eighth son of Kamsa’s sister. Kamsa tried to kill the baby, but that was not to be. A divine intervention ensured the baby was saved. Since then Kamsa has been sending demons to find and kill the baby. Hear the story of Puthana - a fierce demoness!', 'http://54.90.62.46:4800/7exn1udbgsg_1594163290850.jpeg', 'http://54.90.62.46:4800/oxxwc5k20yf_1594163290741.jpeg', '', '', 1, 0, '2020-06-27 18:25:42', '2020-07-10 22:45:40', 1, 1),
(18, 'Blue as the sky', '', 1, '', '', '#802525', 10, 'Lorem ipsum dolor. Lorem ipsum dolor lorem ipsum dolor lorem ipsum dolor.Lorem ipsum dolor. Lorem ipsum dolor lorem ipsum dolor lorem ipsum dolor.Lorem ipsum dolor. Lorem ipsum dolor lorem ipsum dolor lorem ipsum dolor.Lorem ipsum dolor. Lorem ipsum dolor lorem ipsum dolor lorem ipsum dolor.', 'http://54.90.62.46:4800/8li2l5v48fu_1594262585303.jpeg', 'http://54.90.62.46:4800/kbt4hkqtax_1594262584199.jpeg', '', '', 1, 0, '2020-06-27 18:26:40', '2020-07-24 05:25:52', 1, 3),
(22, 'The fight', '', 0, '', '', '#374291', 10, 'Lorem ipsum dolor. Lorem ipsum dolor lorem ipsum dolor lorem ipsum dolor.Lorem ipsum dolor. Lorem ipsum dolor lorem ipsum dolor lorem ipsum dolor.Lorem ipsum dolor. Lorem ipsum dolor lorem ipsum dolor lorem ipsum dolor.Lorem ipsum dolor. Lorem ipsum dolor lorem ipsum dolor lorem ipsum dolor.', 'http://54.90.62.46:4800/ihmir4faawf_1594262624583.jpeg', 'http://54.90.62.46:4800/jvksv9ngrvf_1594262623168.jpeg', '', '', 0, 0, '2020-06-27 20:26:29', '2020-07-10 22:34:11', 1, 2),
(24, 'Ganesh plays with the Chakra', '', 0, '', '', '#2e4e84', 10, 'Lorem ipsum dolor. Lorem ipsum dolor lorem ipsum dolor lorem ipsum dolor.Lorem ipsum dolor. Lorem ipsum dolor lorem ipsum dolor lorem ipsum dolor.Lorem ipsum dolor. Lorem ipsum dolor lorem ipsum dolor lorem ipsum dolor.Lorem ipsum dolor. Lorem ipsum dolor lorem ipsum dolor lorem ipsum dolor.', 'http://54.90.62.46:4800/f0vvsrblpmw_1594262660021.jpeg', 'http://54.90.62.46:4800/u0q9orgceoa_1594262657889.jpeg', '', '', 0, 0, '2020-06-27 20:27:21', '2020-07-10 23:02:11', 1, 2),
(34, 'Ganesha the birth', '', 1, '', 'Kindness', '#4a90e2', 10, 'Of all the gods and goddesses that you know of, perhaps the most beloved is Ganesha, the elephant headed son of Lord Shiva and Goddess Parvati.  But do you know that Ganesha was born as a simple boy with a human head. How did he get his elephant head? That story is an interesting one. Read on to discover.', 'http://54.90.62.46:4800/135v0hnajfo_1594421913425.jpeg', 'http://54.90.62.46:4800/gu1u1ncpxrv_1594421912639.jpeg', 'http://54.90.62.46:4800/135v0hnajfo_1594421913425_pad.jpg', 'http://54.90.62.46:4800/135v0hnajfo_1594421913425_pad.jpg', 0, 1, '2020-07-10 22:58:34', '2020-07-24 06:39:35', 1, 4),
(35, 'Do not look at the moon', '', 0, '', 'Kindness', '#4a90e2', 10, 'Have your parents ever told you not to look at the moon on Ganesh Chathurthi - the birthday of Lord Ganesha? Have you wondered why that is? What could the moon have done?  You will surely find this story interesting and useful.', 'http://54.90.62.46:4800/3sedro9ncfo_1594421975146.jpeg', 'http://54.90.62.46:4800/b8hkfv8yq7l_1594421974362.jpeg', '', '', 0, 1, '2020-07-10 22:59:35', '2020-07-10 22:59:35', 1, 4),
(36, 'Discus diet?', '', 0, '', 'Humanity', '#4a90e2', 10, 'Have you ever seen people crossing their arms and squatting holding their ears before Lord Ganesha? Have you wondered why that is? This story tells you how it all started.', 'http://54.90.62.46:4800/ppalktb0lpj_1594422047647.jpeg', 'http://54.90.62.46:4800/skpe5k3i1w8_1594422046795.jpeg', '', '', 0, 1, '2020-07-10 23:00:48', '2020-07-24 05:25:16', 1, 4),
(37, 'Around the world', '', 0, '', 'Kindness', '#4a90e2', 10, 'Can we go around the world? That too on foot? Sitting on a tiny mouse? Seems impossible, doesn\'t it? But you can and Lord Ganesha showed us how. This is a story of how Ganesha applied his wisdom and intelligence to a seemingly impossible task.', 'http://54.90.62.46:4800/1yp2gilloi7_1594422120295.jpeg', 'http://54.90.62.46:4800/j5lkqbp4b7_1594422120171.jpeg', '', '', 0, 1, '2020-07-10 23:02:00', '2020-07-10 23:02:00', 1, 4),
(38, 'Kubera shows off', '', 0, '', 'News,Tags,Input', '#4a90e2', 10, 'Have you ever come across someone who shows off all the time? How does that make you feel? Well this happened to Ganesha too one day. And guess how he deals with it?', 'http://54.90.62.46:4800/a84ja0e78i_1594422181571.jpeg', 'http://54.90.62.46:4800/5i5fyl8slgg_1594422181342.jpeg', 'http://54.90.62.46:4800/5i5fyl8slgg_1594422181342_pad.png', 'http://54.90.62.46:4800/5i5fyl8slgg_1594422181342_pad.png', 0, 1, '2020-07-10 23:03:01', '2020-07-10 23:03:01', 1, 4),
(39, 'Ganesha turns cool', '', 0, '', 'Humanity', '#4a90e2', 10, 'The journey from elementary to middle school and then to high school is always a challenging one. Both parents and teachers want us to grow up and act mature while we just want to be “Cool”. There is a very interesting story where Ganesha wanted to be “Cool”. But very literally speaking, of course.', 'http://54.90.62.46:4800/89cqjkfp5y9_1594422245655.jpeg', 'http://54.90.62.46:4800/oulf48ickf_1594422245406.jpeg', '', '', 1, 1, '2020-07-10 23:04:05', '2020-07-10 23:04:05', 1, 4),
(40, 'The birth', '', 0, '', 'News,Tags,Input', '#4a90e2', 10, 'Lorem ipsum dolor valet sit. Lorem ipsum dolor valet sit. Lorem ipsum dolor valet sit. Lorem ipsum dolor valet sit. Lorem ipsum dolor valet sit. Lorem ipsum dolor valet sit. Lorem ipsum dolor valet sit. Lorem ipsum dolor valet sit. ', 'http://54.90.62.46:4800/ua1ymq0cd0i_1594422312322.jpeg', 'http://54.90.62.46:4800/hu49h5h3gpo_1594422312075.jpeg', '', '', 0, 1, '2020-07-10 23:05:12', '2020-07-10 23:05:12', 1, 12),
(41, 'The dove who gets protection', '', 0, '', 'Kindness', '#d0021b', 10, 'It is the moral duty of the strong to help and protect the weak. This is all the more important in the case of those in power. But how far should one go down this path especially if this involves giving up something you hold dear? Mahabharata has an interesting story that provides an answer to this.', 'http://54.90.62.46:4800/id4jb8kewkk_1594422401859.jpeg', 'http://54.90.62.46:4800/xujvkktmqce_1594422401329.jpeg', '', '', 0, 1, '2020-07-10 23:06:42', '2020-07-10 23:06:42', 1, 11),
(42, 'The ultimate sacrifice', '', 0, '', 'Humanity', '#417505', 10, 'The word sacrifice means giving up something in favor of something more desirable. Since it involves giving up on something dear to you, you end up in a dilemma. The Mahabharata has a very interesting story on sacrifice about king Shibi who sacrificed everything to keep his word. ', 'http://54.90.62.46:4800/jmjktlssq0q_1594422549370.jpeg', 'http://54.90.62.46:4800/7moj73gkxjh_1594422548793.jpeg', '', '', 1, 1, '2020-07-10 23:09:09', '2020-07-10 23:09:09', 1, 11),
(43, 'Who is the best archer?', '', 0, '', 'Kindness', '#4a90e2', 10, 'We all know and have heard of the several stories of Arjuna, the Pandava prince and one of the best archers in the world. But did you know that there was another archer - equal in skill and talent like Arjuna. This is his story - the story of sacrifice and reverence to his teacher. The story of Eklavya.', 'http://54.90.62.46:4800/rrinqzd48bf_1594422681883.jpeg', 'http://54.90.62.46:4800/ll7q2zban7b_1594422681262.jpeg', '', '', 0, 1, '2020-07-10 23:11:22', '2020-07-10 23:11:22', 1, 11),
(44, 'Ramayan - the beginning ', '', 0, '', 'Kindness', '#4a90e2', 10, 'I am sure you have heard about the epic Ramayana, the story of the brave prince Rama and how he battled with the ten headed demon king Raavan. But, do you know how it all started? This story explains how it all began - long long ago before prince Rama’s birth. ', 'http://54.90.62.46:4800/1hs52mqmqvq_1594422965207.jpeg', 'http://54.90.62.46:4800/60jxjhuxoux_1594422964883.jpeg', '', '', 0, 1, '2020-07-10 23:13:07', '2020-07-10 23:16:05', 1, 7),
(45, 'The royal scions ', '', 0, '', 'Kindness', '#4a90e2', 10, 'The brave prince Dashratha ascended the throne and became the King of Kosala. He was a kind and wise king loved by his subjects. He had three queens -  Kaushalya, Kaikeyi and Sumitra. But he had one sorrow, he had no children. This often made him sad. Read on to see how Lord Vishnu takes birth in the home of King Dashratha and sets into motion the events of Ramayana.', 'http://54.90.62.46:4800/8tl0u69qeyg_1594422937379.jpeg', 'http://54.90.62.46:4800/65z2a2wx75q_1594422937199.jpeg', '', '', 0, 1, '2020-07-10 23:15:37', '2020-07-10 23:15:37', 1, 7),
(46, 'The first test', '', 0, '', 'Kindness', '#4a90e2', 10, 'Time has passed since the birth of the four princes. The brothers are sent to the Sage Vasishtha’s gurukul for their education. There, the brothers learn all the things that princes need to know including - warfare and statesmanship. After completing their studies, the princes come back to Ayodhya. But how ready were they to face demons? ', 'http://54.90.62.46:4800/hqm4ecu3d4t_1594423049548.jpeg', 'http://54.90.62.46:4800/krwwyxuh76_1594423049099.jpeg', '', '', 0, 1, '2020-07-10 23:17:30', '2020-07-24 06:15:48', 1, 7);
