INSERT INTO `StoryPages` (`id`, `page_content`, `page_image`, `ipad_image`, `tablet_image`, `page_number`, `audio_url`, `status`, `createdAt`, `updatedAt`, `StoryId`) VALUES
(8, '<p>A story which explains the god’s association with intelligence and wisdom is his competition with Karthikeya to be the first to marry. They set up a challenge that whoever could first encircle the Earth would also find a bride first. Not wasting a second, Karthikeya swiftly mounted his blue peacock and immediately shot off around the world. Ganesha on the other hand, casually sauntered over to his parents’ house, embraced them and quoted the line from the sacred Vedas: “he who embraces his parents seven times (pradakshinas) gains the merit of encircling the world seven times”. Declared the winner, Ganesha promptly married not one but two daughters of Prajapati: Buddhi (Wisdom) and Siddhi (Success), with whom he had two sons: Kshema and Laabha.</p>', 'http://54.90.62.46:4800/public/story/createStory/imcdnjfcy38_1593843084058.jpeg', '', '', 1, 'http://54.90.62.46:4800/public/story/audio/storyaudio.mp3', 1, '2020-06-27 00:00:00', '2020-06-27 00:00:00', 14),
(9, '<p>Ganesha also has something of a reputation for greediness. One day, after eating a few too many modakas (sacrificial cakes), Ganesha decided to take a ride on his giant rat, Kroncha, to aid his digestion. However, the rat was surprised when he came across a large snake and, jumping back with fear, he threw off his mount. Ganesha landed on his full belly and it burst on hitting the ground. The cakes from his stomach rolled left, right and centre but Ganesha, unperturbed, carefully gathered them in, stuffed them all back into his belly and wound the snake around his midriff to keep it closed. Symbolic of Ganesha’s ability to overcome all obstacles, the snake, the cause of the accident in the first place, therefore provided the remedy for the damage it had caused.</p>', 'http://54.90.62.46:4800/public/story/createStory/imcdnjfcy38_1593843084058.jpeg', '', '', 2, 'http://54.90.62.46:4800/public/story/audio/storyaudio.mp3', 1, '2020-06-27 00:00:00', '2020-06-27 00:00:00', 14),
(10, '<p>Ganesha is the son of Shiva and Parvati and he is the brother of Karthikeya (or Subrahmanya), the god of war. He was created by his mother using earth which she moulded into the shape of a boy. As Shiva was away on his meditative wanderings, Parvati set her new son as guard while she bathed. Unexpectedly, Shiva returned home and, on finding the boy, and outraged at his impudence in claiming he was Parvati’s son, Shiva called for his gang of demons, the bhutaganas, who fought ferociously with the boy. However, the youngster easily held his own against such fearsome adversaries and Vishnu was forced to intervene in the form of Maya and, whilst the boy was distracted by her beauty, the demons, or Shiva himself, lopped off his head. At the commotion, Parvati ran from her bath and remonstrated with Shiva for so summarily killing their son. Repentant, Shiva ordered a new head to be found for the boy and, as the first animal available was an elephant, so Ganesha gained a new head and became the most distinctive of the Hindu gods. As a reward for his great courage in fighting the demons, Shiva made Ganesha the leader of the bhutaganas, hence his name.</p>', 'http://54.90.62.46:4800/public/story/createStory/imcdnjfcy38_1593843084058.jpeg', '', '', 3, 'http://54.90.62.46:4800/public/story/audio/storyaudio.mp3', 1, '2020-07-06 00:00:00', '2020-07-06 00:00:00', 14),
(11, '<p>A story which explains the god’s association with intelligence and wisdom is his competition with Karthikeya to be the first to marry. They set up a challenge that whoever could first encircle the Earth would also find a bride first. Not wasting a second, Karthikeya swiftly mounted his blue peacock and immediately shot off around the world. Ganesha on the other hand, casually sauntered over to his parents’ house, embraced them and quoted the line from the sacred Vedas: “he who embraces his parents seven times (pradakshinas) gains the merit of encircling the world seven times”. Declared the winner, Ganesha promptly married not one but two daughters of Prajapati: Buddhi (Wisdom) and Siddhi (Success), with whom he had two sons: Kshema and Laabha.</p>', '', '', '', 4, 'http://54.90.62.46:4800/public/story/audio/storyaudio.mp3', 1, '2020-07-06 00:00:00', '2020-07-06 00:00:00', 14),
