(13, '<p>Ganesha also has something of a reputation for greediness. One day, after eating a few too many modakas (sacrificial cakes), Ganesha decided to take a ride on his giant rat, Kroncha, to aid his digestion. However, the rat was surprised when he came across a large snake and, jumping back with fear, he threw off his mount. Ganesha landed on his full belly and it burst on hitting the ground. The cakes from his stomach rolled left, right and centre but Ganesha, unperturbed, carefully gathered them in, stuffed them all back into his belly and wound the snake around his midriff to keep it closed. Symbolic of Ganesha’s ability to overcome all obstacles, the snake, the cause of the accident in the first place, therefore provided the remedy for the damage it had caused.</p>', 'http://54.90.62.46:4800/public/story/createStory/imcdnjfcy38_1593843084058.jpeg', '', '', 2, 'http://54.90.62.46:4800/public/story/audio/storyaudio.mp3', 1, '2020-07-07 00:00:00', '2020-07-07 00:00:00', 24),
(14, '<p>yes it is</p>', 'http://54.90.62.46:4800/txw39mrqo2d_1594151820660.jpeg', '', '', 3, 'http://54.90.62.46:4800/i025mnepyip_1594151821567.mpeg', 1, '2020-07-07 19:57:05', '2020-07-10 11:07:24', 24),
(15, '<p>The beautiful city of Mathura on the banks of river Yamuna was the capital of the Vrishni kingdom ruled by the wise king Ugrasena. Ugrasena’s son Kamsa, under the influence of bad company, imprisoned his father and installed himself as the king. Although Kamsa was a tyrant and ruled his kingdom with an iron fist, he also had a soft side. He loved his cousin Devaki who he considered as his own sister.</p><p>On the joyous occasion of her marriage to King Vasudev, Kamsa volunteered to escort the newly-weds and drive the royal chariot.&nbsp; As soon as the newly-weds had been seated in the chariot, a celestial voice prophesied “Kamsa, you are such a fool! The sister and brother-in-law you are so happily escorting will be the cause of your end. Let it be known that the eight son born to Devaki and Vasudev will be the cause of your death.”</p>', 'http://54.90.62.46:4800/8ckihdty7vi_1594420282333.jpeg', '', '', 1, '', 1, '2020-07-10 20:00:53', '2020-07-10 22:31:24', 22),
(16, '<p>Hearing the prophecy, Kamsa’s initial feeling of fright soon turned to anger and he unsheathed his sword to kill Devaki. Vasudev intervened and implored: “Please don’t kill Devaki. We will give you every baby born to us.”</p><p>Kamsa agreed, but decided to imprison Devaki and Vasudeva in the royal dungeons. He visited and killed the first seven babies as soon as they were born. Nine years had passed and&nbsp; Devaki was about to give birth to her eighth baby. Every passing day was painful for Devaki and she cried in fear of Kamsa. Vasudev tried to comfort her.</p><p>On the fateful day when the baby was to be born, Mathura was engulfed in a terrible storm. All of a sudden, the dungeon was suddenly flooded with a brilliant light. Lord Vishnu appeared and informed them that he himself was being born as their eighth son to free them as well as Mathura from the reign of Kamsa. He also instructed Vasudev “After my birth as your son, I want you to take me to the house of your friend, the cowherd chief Nanda in Gokul, where his wife Yashoda would also have given birth to a baby girl. Swap the girl with me and return back to the dungeon with the baby girl. No obstacles will block your path.”</p>', 'http://54.90.62.46:4800/rwwpw70dnx_1594411356711.jpeg', '', '', 2, '', 1, '2020-07-10 20:01:11', '2020-07-10 22:31:52', 22),
(17, '<p>As said, at midnight, Devaki gave birth to a son. Vasudev did as instructed. He picked up the baby in his arms. As he was wondering how to get out of the dungeon, a magical thing happened. All the dungeon guards fell asleep and the prison doors unlocked. As Vasudev hurried towards Gokul, he saw the river Yamuna in spate.&nbsp; But lo and behold … another miracle happened.</p><p>As the rain fell in torrents, the river water made way for Vasudev. Most miraculous of all, a&nbsp; five-mouthed snake followed him spreading his hood providing&nbsp; shelter to the baby from the rain.&nbsp;</p><p>When Vasudev reached Gokul, he found the door of Nanda\'s house open too. He exchanged the babies and hurried back to the dungeons. As soon as he placed the baby girl on the dungeon floor next to Devaki, she cried. Kamsa came charging in, ready to kill the eighth baby of Devaki. Devaki and Vasudev begged Kamsa to spare the baby since it was a girl and not a son as prophesied.</p>', 'http://54.90.62.46:4800/0kejr0zr7kvf_1594420338083.jpeg', '', '', 3, '', 1, '2020-07-10 22:26:33', '2020-07-10 22:32:20', 22),
(18, '<p>Kamsa snatched the baby and threw her against the prison wall. But the baby slipped from his hands and rose up towards the prison ceiling and a bright light engulfed the cell. She transformed into a goddess and told Kamsa “Foolish Kamsa, what will you get by killing me? Your enemy is well and alive elsewhere. You can’t escape your fate.”</p><p>The goddess disappeared and having not much use of Devaki and Vasudev now, Kamsa freed them.&nbsp; He then sends out spies in search of the newborn baby that continued to live.</p><p>Meanwhile, in Gokul, all of Nanda’s subjects were celebrating the birth of the new baby. Chief Nanda named the baby Krishna, Everyone brought gifts and blessings for the baby.</p><p>Thus was the story of the eighth wondrous avatar of Vishnu. Many stories are told of Krishna - the naughty one, the dark one but most importantly the one that taught the world how to live in times of war and peace.</p>', '', '', '', 4, '', 1, '2020-07-10 22:32:36', '2020-07-10 22:32:36', 22),
(19, '<p>High up in the mighty Himalayas lies Mount Kailash, the beautiful abode of Lord Shiva and Goddess Parvati. With Lord Shiva spending long stretches of time in meditation, Goddess Parvati spent her time looking after the needs of their son Kumar and the Ganas - Lord Shiva’s attendants.&nbsp;</p><p>One fine day, when Goddess Parvati decided to spend some time taking a long and relaxed bath, she asked Nandi, Shiva\'s bull “Could you please guard the entrance while I take my bath? Do not let anyone in.” Shiva happened to return at that time and Nandi allowed him inside thinking that Goddess Parvati’s instructions did not apply to Lord Shiva. Shiva\'s sudden appearance surprised Goddess Parvati.</p>', 'http://54.90.62.46:4800/iyu5g6r1rrm_1594423135256.jpeg', 'http://54.90.62.46:4800/135v0hnajfo_1594421913425_pad.jpg', 'http://54.90.62.46:4800/135v0hnajfo_1594421913425_pad.jpg', 1, '', 1, '2020-07-10 23:18:56', '2020-07-10 23:18:56', 34),
(20, '<p>Pondering on this the next day when taking a bath, Parvati took the mound of turmeric-sandalwood paste used for bathing and made a small boy out of it. She then gave life to her creation and lo behold a little boy came alive. She hugged him and said “You are born of me and therefore my son.” The next day when Goddess Parvati went to take her bath she asked the little boy “Could you please guard the entrance while I take my bath? Do not let anyone in.” She gave the boy a little club. The little boy happily went to stand guard at the entrance.</p><p>Just then, Shiva returned. But this time, he was not allowed to enter. Lord Shiva argued, threatened and cajoled but to no avail. The boy did not budge even when the ganas, Lord Vishnu and Lord Brahma tried to reason with him on Shiva\'s request. He politely said “I am obeying my mother’s instructions. No one can go in till she instructs me otherwise.” This enraged the gods present and a huge battle started. During the battle, an enraged Lord Shiva lost his temper and beheaded the boy with his trident.</p>', '', '', '', 2, '', 1, '2020-07-10 23:19:17', '2020-07-10 23:19:17', 34),
(21, '<p>Of all the three hundred and thirty million Gods and Goddesses, the most endearing is Ganesha, the pot-bellied son of Lord Shiva and Goddess Parvathi. One of the anecdotes related to Ganesha Chaturthi - the birthday of Lord Ganesha, is the tradition of not looking at the Moon on that day.&nbsp;</p><p>On one Ganesha Chaturthi, Ganesha having had one too many of his favorite sweets – yummy molasses filled modaks and laddus offered by his devotees and divinities, was on his way back to his home at Kailash. Alas! Ganesha’s full tummy was making it very uncomfortable for him to sit on his mouse – Mushak. So, he grabbed hold of a snake slithering by, tied it around his waist and started on the long journey back.&nbsp;</p><p>It was a very divine sight indeed. Ganesha riding on a commonly considered insignificant animal like a mouse teaches mankind that all beings small or big have their strengths and weaknesses. A mouse due to its size can slither through tiny cracks and crevices.</p>', 'http://54.90.62.46:4800/hjc69i5zg8g_1594423874420.jpeg', '', '', 1, '', 1, '2020-07-10 23:31:15', '2020-07-10 23:31:15', 35),
(22, '<p>It was a nice breezy night with the moon shining up in the sky. Mushak stumbled on a rock and tipped over. Ganesha was thrown off onto the path. He tumbled down, spilling all the sweets he had taken for snacking. Just then, he heard a loud laughter from the sky - “Ha ha ha”. On looking up, he saw the Moon laughing at him.&nbsp;</p><p>Ganesha, annoyed at the sweets spilled in the dust, decided to use the opportunity to teach all of us an important lesson - It is unkind to laugh at someone’s appearance or misfortune. To make sure everyone remembers this, he declared “From this day onward if anyone looks at the moon on my birthday, they will be accused of doing something wrong.”</p>', 'http://54.90.62.46:4800/768ztuh276r_1594423894620.jpeg', '', '', 2, '', 1, '2020-07-10 23:31:35', '2020-07-11 01:24:37', 35),
(23, '<p>Have you ever seen people crossing their arms and squatting holding their ears before Lord Ganesha? This is considered to be a very effective form of pleasing Ganesha and is said to have been started by none other than Lord Vishnu, who is believed to be Ganesha’s uncle.</p><p>This simple age-old ritual has been scientifically endorsed in recent years. Scientists think it may stimulate the human brain and improve mental concentration.</p><p>This is how the story goes. Lord Vishnu, once visited Kailash - the abode of Lord Shiva and Parvati. While Vishnu was busy talking with Lord Shiva and Goddess Parvati, the child Ganesha who was playing nearby saw Vishnu’s mighty discus. Like any curious child, he picked it up and swallowed it to see what it tasted like.</p>', 'http://54.90.62.46:4800/zxqj90xqanj_1594430810796.jpeg', '', '', 1, '', 1, '2020-07-11 01:26:52', '2020-07-11 01:26:52', 36),
(24, '<p>Imagine that! Shiva, Parvati and Vishnu immediately ran to Ganesha, put their fingers into Ganesha’s mouth and tried to get it out. But try as they might - Ganesha refused to open his mouth. When all of the cajoling and bribing did not work, Vishnu had the brilliant idea to do something to make Ganesha laugh.&nbsp;</p><p>After much thought he had a brilliant idea. He said to the child Ganesha “Watch me!” He crossed his arms, caught his ears and started squatting. Up and down the four armed Lord Vishnu went again and again. Ganesha found this sight very funny and could not contain it anymore. He opened his mouth wide and went “Ha ha ha”. The laughing Ganesha could not keep the discus in his mouth. The discus escaped out and returned to Lord Vishnu.</p>', 'http://54.90.62.46:4800/4xr65vc1ygj_1594430844313.jpeg', '', '', 2, '', 1, '2020-07-11 01:27:25', '2020-07-11 01:27:25', 36),
(25, '<p>A very happy Lord Vishnu said with a chuckle “Since this made you so happy, I bless that anyone who does this squatting will receive your mighty blessings.” And hence, we continue to practice this ritual even today!</p>', '', '', '', 3, '', 1, '2020-07-11 01:27:44', '2020-07-11 19:30:59', 36),
(26, '<ul><li>This is my story</li><li>This is first story&nbsp;</li></ul>', '', '', '', 1, '', 1, '2020-07-11 19:31:22', '2020-07-11 19:31:45', 46);
